import * as api from '../api/auth.js';

export const register = (newUser) => async (dispatch) => {
  console.log(newUser);
  try {
    const { data } = await api.register(newUser);
    dispatch({ type: 'REGISTER', payload: data });
  } catch (error) {
    console.log(error.message);
  }
};
